import React from "react";
import { Link } from "react-router-dom";

const ArticleList = ({ articles }) => {
  return (
    <ul>
      {articles.map((article) => (
        <li key={article.uri}>
          <Link to={`/article/${article.uri}`}>
            <h2>{article.title}</h2>
            <p>{article.abstract}</p>
          </Link>
        </li>
      ))}
    </ul>
  );
};

export default ArticleList;
